import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Listing from './app/Listing/Listing';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Default Home Page */}
          <Route
            path="/"
            element={
              <a
                className="App-link"
                href="/listing"
                rel="noopener noreferrer"
              >
                Go to Listing Page
              </a>
            }
          />

          {/* Listing Page */}
          <Route path="/listing" element={<Listing />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
